			"club_info": {
				"display_name": "DDX Красногорск",
				"description": "Стильное пространство, итальянские тренажёры TechnoGym, мощная система вентиляции и зона SPA, как в лучших отелях мира - это все о DDX Fitness.\r\nВ каждый тариф входит мягкая программа адаптации для начинающих и занятия с тренером в мини-группах SMART START. Это значит, что уже с первых посещений ты сможешь получать удовольствие от комфортных и безопасных тренировок.\r\n\r\nЧто еще есть в клубе:\r\n• Общая площадь клуба 2400 м²;\r\n• Высокие потолки (12 метров), панорамные окна;\r\n• Зоны функционального тренинга Cross Box, DDX Athletic;\r\n• Специальная зона с петлями TRX;\r\n• Зона со свободными весами от эргономичной линейки Pure Strength;\r\n• Большой выбор кардио-тренажёров;\r\n• Огромный выбор групповых программ;\r\n• Анализатор состава тела InBody;\r\n• Финская сауна, турецкий хаммам, соляная комната и душевая в зоне SPA;\r\n• Гидромассажные ванны  с панорамным видом на березовую рощу;\r\n• Солярий;\r\n• Неспортивные игры;\r\n• Турниры, конкурсы, фестивали, баттлы, призы и подарки."
			},
